import React, { useState, useEffect } from "react";

const Repos = ({ url }) => {
    const [commits, setCommits] = useState('')

    useEffect(() => {
        (async() => {
            const result = await fetch(url)
	        const repos = await result.json()

            setCommits(repos)
        })()
    }, [url])

    return(
        <div>
           { console.log(commits) }
        </div>
    )
}


export default Repos
